&lt;p&gt;&lt;a href="http://www.flickr.com/people/abhijeetv/"&gt;AbhijeetVardhan&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/abhijeetv/4625942479/" title="Tomb of Akbar the Great"&gt;&lt;img src="http://farm5.static.flickr.com/4018/4625942479_d85fdf7f9d_m.jpg" width="240" height="156" alt="Tomb of Akbar the Great" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Now we move on from the Taj Mahal to another very important Mughal architectural masterpiece: the tomb of &lt;a href="http://en.wikipedia.org/wiki/Tomb_of_Akbar_the_Great" rel="nofollow"&gt;Akbar the Great&lt;/a&gt;. It was built during 1605-1613, and is located in Sikandra, a suburb of Agra, Uttar Pradesh, India. This is main entrance to the tomb complex.&lt;br /&gt;
&lt;br /&gt;
The architecture and the details in the interior are so beautiful and impressive. Not many people visit this tomb (compared to the Taj Mahal) but, IMHO, this is as significant and architecturally beautiful as the Taj.&lt;br /&gt;
&lt;br /&gt;
Have a look at my &lt;a href="http://www.flickr.com/photos/abhijeetv/sets/72157623929017831/"&gt;Agra&lt;/a&gt; set.&lt;br /&gt;
&lt;br /&gt;
Wishing you all a wonderful weekend... the weather gods seem to be very kind!&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/ammdgs/"&gt;antoniogs&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/ammdgs/4627884312/" title="Road work, Agra"&gt;&lt;img src="http://farm5.static.flickr.com/4072/4627884312_10e0a02f89_m.jpg" width="240" height="160" alt="Road work, Agra" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Road works in and out of cities are a constant. Women work on them quite often. Hard labour with the heat, dust and pollution.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/abhijeetv/"&gt;AbhijeetVardhan&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/abhijeetv/4629089724/" title="The final resting place..."&gt;&lt;img src="http://farm4.static.flickr.com/3393/4629089724_e3761c3d70_m.jpg" width="240" height="155" alt="The final resting place..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This is the actual structure that houses the tomb of Akbar the Great. The whole complex is architecturally beautiful and massive, yet the grave itself only contains plain marble stones without any carvings/decorations etc.&lt;br /&gt;
&lt;br /&gt;
The architecture incorporates influences from Islam, Hinduism and Christianity.&lt;br /&gt;
&lt;br /&gt;
Have a look at my &lt;a href="http://www.flickr.com/photos/abhijeetv/sets/72157623929017831/"&gt;Agra&lt;/a&gt; set.&lt;br /&gt;
&lt;br /&gt;
Wishing you all a great weekend!&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/abhijeetv/"&gt;AbhijeetVardhan&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/abhijeetv/4631526709/" title="The entrance..."&gt;&lt;img src="http://farm4.static.flickr.com/3156/4631526709_959fcec89b_m.jpg" width="157" height="240" alt="The entrance..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;... to the emperor's tomb. You need to see the details for yourself to experience its beauty. Shot using the Sigma 10-20mm wide angle lens at 10mm and ISO 1250, hence the distortions and loss of clarity.&lt;br /&gt;
&lt;br /&gt;
&lt;i&gt;You will reach the emperor's tomb, a pyramidal structure, after walking through the char baghs (four gardens, a concept implemented in the layout of Taj Mahal too). There is an open terrace atop the tomb. The terrace is enclosed within huge panels of jail screens. It has a replica of the sarcophagus. The real tomb of the great emperor Akbar lies in the basement. The basement of the monument may be reached from a portico. You will find the portico stunningly beautiful with the stucco paintings. The paintings with the floral designs in gold, blue, and green carry the flavor of Persia. These are the best pieces of work seen on any of the Mughal buildings.&lt;br /&gt;
&lt;br /&gt;
This tomb was damaged during one of the invasions in late 16th century and has been partially restored&lt;/i&gt;&lt;br /&gt;
&lt;br /&gt;
Have a look at my &lt;a href="http://www.flickr.com/photos/abhijeetv/sets/72157623929017831/"&gt;Agra&lt;/a&gt; set.&lt;/p&gt;

