&lt;p&gt;As they say in India, there are two categories of people in the world: those who saw Taj and those who didn't. It is insanely beautiful and no picture can do it justice. Especially not when it is taken with an iPhone camera.&lt;br /&gt;
&lt;br /&gt;
One more picture is in the comments section and it is not as self-explanatory. The guy there is my self-appointed guide for the morning. There is no way you will be left alone when you go anywhere near Taj, so it is much easier to surrender to one of these guys as soon as possible - saves time and energy. After looking at Taj the regular way, he offered to take me to a place where you can see  it from the rooftops. I thought it must be somewhere around the corner and agreed. But it wasn't. It involved taking a ride on his motorcycle - on the back seat and without a helmet. And in crazy Agra traffic where cars and countless cows are all trying to run you over or off the road. My knee practically brushed against the side of the huge ox when he was making a sharp turn (my guide, not ox). We did get to the place in one piece and the view was really cool, not your usual touristy view at all - I'll post a non-iPhone picture when I am back home. But now I also know I am a moron because I did agree to this ride.&lt;/p&gt;

