&lt;p&gt;Sony A900 + Sony 16-35ZA&lt;br /&gt;
&lt;br /&gt;
The Taj Mahal is a mausoleum located in Agra, India, built by Mughal emperor Shah Jahan in memory of his favorite wife, Mumtaz Mahal.&lt;br /&gt;
The Taj Mahal is considered the finest example of Mughal architecture, a style that combines elements from Islamic, Indian and Persian architectural styles.  In 1983, the Taj Mahal became a UNESCO World Heritage Site.&lt;br /&gt;
&lt;br /&gt;
While the white domed marble mausoleum is its most familiar component, the Taj Mahal is actually an integrated complex of structures. Building began around 1632 and was completed around 1653, and employed thousands of artisans and craftsmen.  The construction of the Taj Mahal was entrusted to a board of architects under imperial supervision including Abd ul-Karim Ma'mur Khan, Makramat Khan, and Ustad Ahmad Lahauri.  The Persian Lahauri is generally considered to be the principal designer.&lt;br /&gt;
