&lt;p&gt;In order to get here, the other side of Taj Mahal across Yamuna River, we have to take Auto Rick Shaw that charge us Indian Rupee 350 per Auto Rick Shaw from Taj Ganj and took almost 45 minutes to get here. We have to pay another Indian Rupee 100 (  Apprx USD 2) per person for entrance fee to get inside this location. This is a perfect pace to capture Taj Mahal bath in sunset or sunrise if the weather was good. Unfortunately for us, the weather wasn't on our side.&lt;/p&gt;

