&lt;p&gt;These people run like crazy because the floor is too hot for the feet, the temperature here is approximately more than 45 degrees, so you can imagine how hot it is. Just for your information, we can't use shoes here. They are not running from anything but trying not to stay too long on the floor, it might burned their feet.&lt;br /&gt;
&lt;br /&gt;
