&lt;p&gt;We now travel up to the Agra Fort.  It is located about 1.3 miles west of the Taj Mahal on the west bank of the Yamuna river, which also flows past the back side of the Taj Mahal.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4742591987/" title="India383"&gt;&lt;img src="http://farm5.static.flickr.com/4101/4742591987_b99d8ab8c0_m.jpg" width="240" height="159" alt="India383" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The entrance gate into the Agra Fort&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4742592223/" title="India384"&gt;&lt;img src="http://farm5.static.flickr.com/4076/4742592223_cd1c33c491_m.jpg" width="240" height="159" alt="India384" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This is an example of the buildings added by Shah Jahan, who built the Taj Mahal.  Shah Jahan added the buildings made from white marble, often inlaid with gold or semi-precious gems. He destroyed some of the earlier buildings inside the fort in order to make his own.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

