&lt;p&gt;Interior structures in the Agra Fort&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4742592687/" title="India386"&gt;&lt;img src="http://farm5.static.flickr.com/4121/4742592687_e90aeff034_m.jpg" width="240" height="159" alt="India386" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Shah Jahan, who built the Taj mahal, added these buildings made from white marble, often inlaid with gold or semi-precious gems. He destroyed some of the earlier buildings inside the Agra fort in order to make his own.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4742593113/" title="India388"&gt;&lt;img src="http://farm5.static.flickr.com/4096/4742593113_dd49fa9ff7_m.jpg" width="240" height="159" alt="India388" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Closeup of the inlay work in white marble that was added by Shah Jahan, who built the Taj mahal.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/rons-best/"&gt;Ron's selected photos&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rons-best/4742593703/" title="India390"&gt;&lt;img src="http://farm5.static.flickr.com/4099/4742593703_e1393a3d1b_m.jpg" width="240" height="159" alt="India390" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;At the end of his life, Shah Jahan, who built the Taj Mahal, was imprisoned by his son, Aurangzeb, in the Agra fort..  It is rumored that Shah Jahan died in Muasamman Burj, this tower with a marble balcony that looks out at the Taj Mahal, which can be seen here in the distance.&lt;/p&gt;

