&lt;p&gt;Originally built of brick as early as 1080 AD, the Agra fort became a seat of government of India in the mid 1500s.  At that time it was rebuilt with red sandstone from the Barauli area in Rajasthan.  Some 1,444,000 builders worked on it for eight years, completing it in 1573.  It finally took its present state during the reign of Shah Jahan, who built the Taj Mahal.&lt;/p&gt;

