&lt;p&gt;Taj Mahal  and Yamuna river at sunrise, Agra, India.&lt;br /&gt;
&lt;br /&gt;
Taj Mahal was built by Mughal emperor Shah Jahan in memory of his favorite wife, Mumtaz Mahal and is considered the finest example of Mughal architecture, a style that combines elements from Islamic, Indian and Persian architectural styles. In 1983, the Taj Mahal became a UNESCO World Heritage Site and was cited as &amp;quot;the jewel of Muslim art in India and one of the universally admired masterpieces of the world's heritage.&amp;quot;&lt;br /&gt;
&lt;br /&gt;
Building began around 1632 and was completed around 1653, and employed thousands of artisans and craftsmen. Soon after the Taj Mahal's completion, Shah Jahan was deposed by his son Aurangzeb and put under house arrest at nearby Agra Fort where he could gaze upon Taj from a distance. By the late 19th century, parts of the buildings had fallen badly into disrepair. During the time of the Indian rebellion of 1857, the Taj Mahal was defaced by British soldiers and government officials, who chiseled out precious stones from its walls. At the end of the 19th century, British viceroy ordered a massive restoration project, which was completed in 1908. During this time the garden was remodeled with British-style lawns that are still in place today.&lt;/p&gt;

