The Taj Mahal (play /Ààt…ëÀê í m…ôÀàh…ëÀêl/; Hindi: ‡§§‡§æ‡§ú ‡§Æ‡§π‡§≤ [taÀêd ë m…õ…¶…õl];[dubious ‚Äì discuss] Persian/Urdu: ÿ™ÿßÿ¨ ŸÖÿ≠ŸÑ) is a mausoleum located in Agra, India, built by Mughal emperor Shah Jahan in memory of his favorite wife, Mumtaz Mahal. Taj Mahal means &amp;quot;crown of buildings&amp;quot; in Urdu.[1]&lt;br /&gt;
&lt;br /&gt;
The Taj Mahal (also &amp;quot;the Taj&amp;quot;) is considered the finest example of Mughal architecture, a style that combines elements from Islamic, Indian and Persian architectural styles.[2][3]&lt;br /&gt;
&lt;br /&gt;
In 1983, the Taj Mahal became a UNESCO World Heritage Site. In a project that attempted to update the Seven Wonders of the Ancient World, popularity poll was led by Canadian-Swiss Bernard Weber and organized by the Swiss-based, government-controlled New7Wonders Foundation considered Taj Mahal to be one of the present new seven wonders of the world.&lt;br /&gt;
&lt;br /&gt;
While the white domed marble mausoleum is its most familiar component, the Taj Mahal is actually an integrated complex of structures. Building began around 1632 and was completed around 1653, and employed thousands of artisans and craftsmen.[4] The construction of the Taj Mahal was entrusted to a board of architects under imperial supervision including Abd ul-Karim Ma'mur Khan, Makramat Khan, and Ustad Ahmad Lahauri.[5][6] Lahauri[7] is generally considered to be the principal designer.[8]&lt;/p&gt;

