&lt;p&gt;I was actually waiting for the woman to go so that I could get a clear shot of this particular side of the Taj Mahal, but then thought, she'll probably be there all day, so just took the photo, it probably helps to add a little perspective, as well as a nice contrast to the rest of the picture. You may think that that minaret in the background is extremely crooked, but if you look at the rest of the picture, everything seems a little crooked. For something that is so symmetrical and perfectly designed, the photos sure do seem to be uneven.&lt;br /&gt;
It's a little bit dark (because of the sky), I might try using Photomatix to get the building a bit lighter.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/dtracorp/"&gt;dtra&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dtracorp/4844785491/" title="Through the doorway"&gt;&lt;img src="http://farm5.static.flickr.com/4083/4844785491_96016fae4b_m.jpg" width="160" height="240" alt="Through the doorway" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This is the Taj Mahal through one of the doorways in the guest house, one of the great things about the Taj Mahal complex, it looks the same from all four sides, well, the mosque and guesthouse are identical on the east and west, and the the fountains and pools are only on the southern side, and there isn't anything on the northern side (the river), the actual mausoleum building is identical on all four sides. This is a two shot HDR, it is lacking a bit of contrast, but I think the composition is nice.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/dtracorp/"&gt;dtra&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dtracorp/4847608743/" title="From the Garden"&gt;&lt;img src="http://farm5.static.flickr.com/4088/4847608743_1a9b34d165_m.jpg" width="240" height="161" alt="From the Garden" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Another shot of the Taj Mahal, this time from the garden, with the guest house in the background. It was approaching sunset, and the light finally started getting more colourful, but it was just about time to go, I wasn't expecting anything special from the sunset, and it turned out that way, with some windy, dusty, rain (very light) clouds moving in.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/dtracorp/"&gt;dtra&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dtracorp/4847609621/" title="Another Angle of the Taj Mahal"&gt;&lt;img src="http://farm5.static.flickr.com/4150/4847609621_e994b430a8_m.jpg" width="240" height="156" alt="Another Angle of the Taj Mahal" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;As if you haven't seen enough already, this one is taken from the mosque side, I just managed to fit it all in with the DA21. It's just great that it is identical on each of the four sides, means you can get some pretty nice pictures with less tourists in the photo if you just go around to one of the less popular sides.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/shadespar/"&gt;Praveer Shukla&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/shadespar/4848384431/" title="......everybody's changing....."&gt;&lt;img src="http://farm5.static.flickr.com/4093/4848384431_595d24c209_m.jpg" width="240" height="180" alt="......everybody's changing....." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;So little time,&lt;br /&gt;
Try to understand that I'm,&lt;br /&gt;
Trying to make a move just to stay in the game,&lt;br /&gt;
I try to stay awake and remember my name&lt;br /&gt;
But everybody's changing,&lt;br /&gt;
And I don't feel the same..&lt;br /&gt;
&lt;br /&gt;
You're gone from here&lt;br /&gt;
Soon you will disappear&lt;br /&gt;
Fading into beautiful light&lt;br /&gt;
'Cause everybody's changing&lt;br /&gt;
And I don't feel right ....&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/dtracorp/"&gt;dtra&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dtracorp/4852103197/" title="The South Gate"&gt;&lt;img src="http://farm5.static.flickr.com/4137/4852103197_abafb22927_m.jpg" width="240" height="161" alt="The South Gate" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;And finally, we left the Taj Mahal complex, and I took one final shot of the South Gate (the main entrance) as people continued flocking in, probably for the sunset. This time of year there are many more Indian tourists compared to foreign tourists according to my guide, it doesn't cost them much to enter, so I don't see why they would have fewer numbers at other times in the year (when the weather and light are probably better).&lt;/p&gt;

