&lt;p&gt;The famous Taj Mahal in Agra was one monument that really stood up to my high expectations. In the warm evening light before sunset the white marble mausoleum to Mughal emperor Shah Jahan's favourite wife truly glowed. It's impressive scale and fantastic ornamentation make this world-renowned  monument worthy of every ounce of fame and adoration it receives.&lt;/p&gt;

