&lt;p&gt;The Taj Mahal is a mausoleum located in Agra, India. It was built by Mughal emperor Shah Jahan in memory of his third wife, Mumtaz Mahal. Taj Mahal is considered to be the finest example of Mughal architecture, a style that combines elements from Persian, Islamic and Indian architectural styles. In 1983, the Taj Mahal became a UNESCO World Heritage Site.&lt;/p&gt;

