&lt;p&gt;&lt;a href="http://www.flickr.com/people/53074327@N07/"&gt;Across the Globe&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/53074327@N07/4978779728/" title="Taj Mahal in Black-and-White"&gt;&lt;img src="http://farm5.static.flickr.com/4092/4978779728_e4d2312c41_m.jpg" width="240" height="165" alt="Taj Mahal in Black-and-White" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This monument needs no introduction of course. I do not do much black-and-white photography, but this angle looked interesting. Unless someone takes a very unconventional photo like the one taken by HDR maestro Trey Ratcliff from outside the Taj grounds, it is very difficult to avoid tourist interference. On that note, if you haven't seen Trey's masterpiece you can see it in &lt;a href="http://www.flickr.com/photos/stuckincustoms/2035748576/"&gt;www.flickr.com/photos/stuckincustoms/2035748576/&lt;/a&gt; &lt;br /&gt;
&lt;br /&gt;
Legend has it that Emperor Shah Jahan built this mausoleoum in memory of his beloved wife Mumtaz Mahal. I have heard another theory. According to this highly opinionated cynical view, Shah Jahan probably realized that unlike his predecessors he did not fight great wars or do any deeds of historical importance. However he did  like architecture. So he had this unique  monument built as the symbol of eternal love which would ensure that he would be remembered among the great Mughal Emperors. Shah Jahan is indeed considered one of the six great Mughal Emperors as a result of this. &lt;br /&gt;
&lt;br /&gt;
While I do not favour either theory, I do find a strange sense of peace and tranquility whenever I visit the Taj Mahal.&lt;/p&gt;

