A sari or saree (Bengali: ‡¶∂‡¶æ‡¶°‡¶º‡¶ø sha·πõi, Hindi: ‡§∏‡§æ‡§°‡§º‡•Ä sƒÅ·πõƒ´,Oriya: ‡¨∂‡¨æ‡¨¢‡≠Ä sƒÅddhi,Kannada: ‡≤∏‡≥Ä‡≤∞‡≥Ü, sƒ´re, Malayalam: ‡¥∏‡¥æ‡¥∞‡¥ø sƒÅri, Marathi: ‡§∏‡§æ‡§°‡§º‡•Ä sƒÅ·πõƒ´, Nepali: ‡§∏‡§∞‡§ø sari, Punjabi: ‡®∏‡®æ‡®∞‡©Ä sƒÅrƒ´, Tamil: ‡Æ™‡ØÅ‡Æü‡Æµ‡Øà pu·π≠avai, Telugu: ‡∞ö‡±Ä‡∞∞ cƒ´ra, Urdu: ÿ≥ÿß⁄ëŸâ sƒÅ·πõƒ´) is a strip of unstitched cloth, ranging from four to nine metres in length that is draped over the body in various styles.[1] It is popular in India, Nepal, Bangladesh, Pakistan, Sri Lanka, Bhutan, Burma, and Malaysia. The most common style is for the sari to be wrapped around the waist, with one end then draped over the shoulder baring the midriff.&lt;br /&gt;
&lt;br /&gt;
The sari is usually worn over a petticoat (‡§≤‡§π‡§Ç‡§ó‡§æ laha·πÖgƒÅ or &amp;quot;lehenga&amp;quot; in the north, pavada/pavadai in the south, chaniyo in the west, and shaya in eastern India), with a blouse known as a choli or ravika forming the upper garment. The choli has short sleeves and a low neck and is usually cropped, and as such is particularly well-suited for wear in the sultry South Asian summers. Cholis may be backless or of a halter neck style. These are usually more dressy with plenty of embellishments such as mirrors or embroidery, and may be worn on special occasions. Women in the armed forces, when wearing a sari uniform, don a short-sleeved shirt tucked in at the waist. The sari developed as a garment of its own in both South and North India at around the same time, and is in popular culture an epitome of Indian culture.&lt;br /&gt;
