&lt;p&gt;The Taj Mahal (/Ààt…ëÀêd í m…ôÀàh…ëÀêl/; Hindi/Urdu [tÃ™aÀêd ë m…õ…¶…ôl] also &amp;quot;the Taj&amp;quot;; means &amp;quot;crown of buildings&amp;quot; in Urdu) is a mausoleum located in Agra, India. It is one of the most recognizable structures in the world. It was built by Mughal emperor Shah Jahan in memory of his third wife, Mumtaz Mahal.&lt;br /&gt;
&lt;br /&gt;
Taj Mahal is considered to be the finest example of Mughal architecture, a style that combines elements from Persian, Islamic and Indian architectural styles.&lt;br /&gt;
&lt;br /&gt;
In 1983, the Taj Mahal became a UNESCO World Heritage Site. While the white domed marble mausoleum is the most familiar component of the Taj Mahal, it is actually an integrated complex of structures. The construction began around 1632 and was completed around 1653, employing thousands of artisans and craftsmen. The construction of the Taj Mahal was entrusted to a board of architects under imperial supervision, including Abd ul-Karim Ma'mur Khan, Makramat Khan, and Ustad Ahmad Lahauri. Lahauri is generally considered to be the principal designer.&lt;br /&gt;
