&lt;p&gt;The Great Gate or Darwaza-I-Rauza - the gateway to the Taj Mahal is an awesome structure in its own might. There are the three outlying gates surrounding Taj Mahal grounds; the fourth river facing side is left open. I was advised to lineup early at the west gate as it opens ealiest. I had to specifically ask the Taxi driver that I want to go to the West Gate. For some reason taxi drivers prefer to drop people off at other gates.&lt;/p&gt;

