&lt;p&gt;When I saw this I recalled a lesson from school history.  Akbar the Great (the greatest of all Mughal rulers)  in a fit of anger, had his beloved foster brother Adham Khan thrown down from the ramparts of this fort. When soldiers reported that Adham Khan had survived, Akbar had him brought up immediately and thrown down again. This time Adham did not survive.  Adham's crime was abuse of power and cold blooded murder of Akbar's Prime Minister. &lt;br /&gt;
&lt;br /&gt;
I asked our tour guide about this. He reluctantly recounted the incident. It seems that tour guides are more prone to flowery praise of the greats and gloss over the murky past.  He couldnt however, confirm exactly where Adham Khan was thrown from.&lt;/p&gt;

