&lt;p&gt;Taj Mahal - Agra - India&lt;br /&gt;
Taj Mahal, a dream etched in milky white pristine marble is the peerless monument portraying the beauty of eternal love! A commemoration of the memory of Shahjahan's beloved wife, Mumtaz. Taj Mahal is indeed India's rich tribute to womanhood. Renowned for its aesthetic beauty, this extravagant building of timeless beauty is the outcome of a unique combination of passion and architectural exuberance.&lt;/p&gt;
